import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using placeholder attribute (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Attempt XSS payload in the search input
    const xssPayload = `<img src=x onerror=alert('XSS')>`;
    await page.fill('input[placeholder="Search Amazon"]', xssPayload);

    // Take screenshot after filling input
    const step2 = path.join(screenshotsDir, 'step_2_xss_input.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the search button using XPath (different selector strategy)
    const searchBtnXPath = '//button[contains(@class, "search-btn")]';
    await page.waitForSelector(searchBtnXPath, { timeout: 5000 });

    // Click the first visible search button (there may be multiple)
    const searchBtns = await page.$$(searchBtnXPath);
    let clicked = false;
    for (const btn of searchBtns) {
      if (await btn.isVisible()) {
        await btn.click();
        clicked = true;
        break;
      }
    }

    // Take screenshot after clicking search
    const step3 = path.join(screenshotsDir, 'step_3_after_search.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Wait for any element that may reflect the search input (try by text)
    let reflected = false;
    let reflectedText = '';
    try {
      // Wait for a heading or div containing the payload (search results title)
      const resultSelector = `text="${xssPayload}"`;
      await page.waitForSelector(resultSelector, { timeout: 3000 });
      reflected = true;
      reflectedText = xssPayload;
    } catch (e) {
      // Not reflected as text, try to see if the payload appears in HTML
      const content = await page.content();
      if (content.includes(xssPayload)) {
        reflected = true;
        reflectedText = xssPayload;
      }
    }

    // Take screenshot after possible XSS reflection
    const step4 = path.join(screenshotsDir, 'step_4_reflection_check.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Extract any visible element that contains the payload
    let extractedData = {};
    if (reflected) {
      extractedData = { xssReflected: true, reflectedText };
    } else {
      extractedData = { xssReflected: false };
    }

    return {
      success: true,
      action: "Attempted XSS via search input and checked for payload reflection",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
